import iconLogo from './images/Group 19@3x.png';

function logoButton() {
  return (
    <div>
      <a href="/">
        <img
          className="icon-logo"
          src={iconLogo}
          alt='Logo'
        />
        {/* <img class="text-logo" src="" alt="Text-logo" /> */}
      </a>
    </div>
  );
}

export default logoButton;
